import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { RegisterRequest } from '../models/register.model';
import { ApiService } from '../services/api.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  standalone: false,
  templateUrl: './register.component.html',
  styleUrl: './register.component.css'
})
export class RegisterComponent {
  registerForm: FormGroup;

  constructor(private fb: FormBuilder, private apiService: ApiService, private router: Router) {
    this.registerForm = this.fb.group({
      name: ['', Validators.required],
      email: ['', [Validators.required, Validators.email]],
      dni: ['', Validators.required],
      birthDate: ['', Validators.required],
      city: ['', Validators.required], 
      password: ['', [Validators.required, Validators.minLength(6)]],
      confirmPassword: ['', Validators.required],
      acceptTerms: [false, Validators.requiredTrue]
    }, { validator: this.passwordMatchValidator });
  }

  passwordMatchValidator(form: FormGroup) {
    return form.get('password')?.value === form.get('confirmPassword')?.value
      ? null : { mismatch: true };
  }

  onSubmit() {
    if (this.registerForm.valid) {
      const form: RegisterRequest = {
        dni: this.registerForm.value.dni,
        name: this.registerForm.value.name,
        email: this.registerForm.value.email,
        birthDate: this.registerForm.value.birthDate,
        city: this.registerForm.value.city,
        password: this.registerForm.value.password
      };

      this.apiService.register(form).subscribe(
        (res) => {
          console.log("Registro exitoso:", res);
          this.router.navigate(["/login"]);
        },
        (error) => {
          console.error("Error en el registro:", error);
        }
      );
    } else {
      console.log('Formulario de registro inválido');
    }
  }
}
<div class="container">
  <div class="register-box">
    <img src="assets/logo2.png" alt="Logo" class="logo">
    <h2>REGISTRARSE</h2>

    <form [formGroup]="registerForm" (ngSubmit)="onSubmit()">
      <input type="text" placeholder="Nombre de usuario" formControlName="name">
      <input type="email" placeholder="Correo electrónico" formControlName="email">
      <input type="password" placeholder="Contraseña" formControlName="password">
      <input type="password" placeholder="Confirmar contraseña" formControlName="confirmPassword">
      <input type="text" placeholder="DNI" formControlName="dni">
      <input type="date" placeholder="Fecha de ancimiento" formControlName="birthDate">
      <input type="text" placeholder="Ciudad" formControlName="city">

      <div class="options">
        <label>
          <input type="checkbox" formControlName="acceptTerms" class="recordar"> Acepto los términos y condiciones
        </label>
      </div>

      <button type="submit" [disabled]="!registerForm.valid">REGISTRARSE</button>
      <br><br>
      <div>
        <a class="login" href="/login">¿Ya tienes cuenta? Inicia sesión aquí</a>
      </div>
    </form>
  </div>
</div>
